import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import SearchButton from './SearchButton';
import reportWebVitals from './reportWebVitals';
import InputSearch from './InputSearch';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

const searchbutton = ReactDOM.createRoot(document.getElementById('searchbutton'));
searchbutton.render(
  <React.StrictMode>
    <SearchButton />
  </React.StrictMode>
);


const inputsearch = ReactDOM.createRoot(document.getElementById('inputsearch'));
searchbutton.render(
  <React.StrictMode>
    <InputSearch/>
  </React.StrictMode>
);














// If you want to start measuring performance in your app, pass a function
